import React, { useEffect } from "react";

const Timerr = () => {
  const [count, seTcount] = useState(0);
  useEffect(() => {
    setTimeout(() => {
      seTcount((count) => count + 1);
    });
  });
  return (
    <>
      <h1>I have rendered {count} times</h1>
    </>
  );
};

export default Timerr;
